import Header from "./components/Header/Header";

function App() {
  return (
    <>
      <div className='container p-2' >
        <div className='column'>

          <hr />
          <Header />
          <hr />
          <div className=''>
          <Form {...{ addOrEditTarea, currentId, tareas }} />
            <Tareas />
          </div>
        </div>
        <ToastContainer />
      </div>
    </>
  );
}

export default App;
